import React from 'react';

class App extends React.Component{
  render(){
    const quizset = [
      {
        question : "1+1 = ",
        options : [2, 3, 4, 5],
        correct_answer : 2
      },
      {
        question : "1+2=",
        options : [2,3,4,5],
        correct_answer : 3
      },
      {
        question : "2+3=",
        options : [3,4,5,6],
        correct_answer : 5
      }
    ];
    return (
     <div>
       {quizset.map(question => {
         <div>{question.question}</div>
       })}
     </div>
    );
  }
}



export default App;
